define({"topics" : [{"title":"User, hosts, and application properties","shortdesc":"\n            <p class=\"shortdesc\">Each of the three LDAP entity types Users, Hosts, and         Applications         has a default set of properties (technically,\n               LDAP attributes), which are displayed in the         CONDITIONS         section of Subject components.\n            </p>\n         ","href":"user_host_and_group_properties.html","attributes": {"data-id":"user_host_and_group_properties",},"menu": {"hasChildren":false,},"tocID":"user_host_and_group_properties-d66e1348","topics":[]},{"title":"About Property Manager","shortdesc":"\n            <p class=\"shortdesc\">The Property Manager utility (<span class=\"keyword cmdname\">propertymgr.bat</span>) enables you to         define custom properties for User and Computer components, and for user and host         groups.\n            </p>\n         ","href":"about_property_manager.html","attributes": {"data-id":"about_property_manager",},"menu": {"hasChildren":true,},"tocID":"about_property_manager-d66e1367","next":"about_property_manager-d66e1367",},{"title":"Portal content properties","shortdesc":"\n            <p class=\"shortdesc\">Portal content properties are the properties that appear by default in the Property         Name combo-box of the component\n               definition. \n            </p>\n         ","href":"portal_content_properties.html","attributes": {"data-id":"portal_content_properties",},"menu": {"hasChildren":true,},"tocID":"portal_content_properties-d66e1425","next":"portal_content_properties-d66e1425",}]});